Hampir 2 minggu yang lalu @liuherman kembali bertemu sosok yang menginspirasi, nama beliau adalah Kamaruddin Lubis, lahir di tahun 1930.. so, lbh kurang saat ini umur beliau sudah 87 tahun..
Wahhh... Di umur senja, beliau tetap semangat membiayai keluarga beliau, saat ini pak Kamaruddin hidup berdua dengan istrinya di rumah. 
Namun ada sedikit cerita yang menyedihkan, sehari2 beliau mengambil tape dengan modal 3rb per bungkus.. dan menjual 3 bungkus seharga 10rb.. waduh hanya 1rb untung nya stiap penjualan 3 bungkus.. Selain itu, beliau juga harus mengeluarkan biaya transportasi sehari2nya yaitu senilai 20rb rupiah utk ongkos naik becak.. Waduh brrti beliau harus menjual 60 bungkus baru bisa nutupi ongkosnya.. belum lagi untung.. kadang2 bisa rugi.. kalau uda rusak tape nya.. Tapi bagaimanapun semoga beliau diberikan kesehatan dan umur yang panjang agar tetap bisa menjalani hidupnya.. Doain beliau ya guys

Kalau ada yg mau beli dagangannya.. Ada di depan komplek malibu medan. Jl laud soewondo medan.
